<p class="large-type">Local Deals is the platform which is  useful for the all kinds of retail shops and local merchants. Its mainly focus on local merchants in most populated countries like India. Here we are helping entrepreneurs by providing coupons for the particular outlet or store. People who visit on online they can search stores by their area and requirements and get coupon through email or SMS. The main goal Use Coupon – Get Discount – Help local Merchants – Make people Happy .</p>
