<div class="cta-module--submodule-content">
<p class="large-type">This website is mainly based on the generating coupons where thee coupon allows shopkeepers to add any number of coupon codes to a discount. Customers may use a coupon code on the checkout form to attempt to activate the related discount. If there are other conditions on the discount that prevent it from being applied to the items in the shop, the customer will be notified. Otherwise the discount will be applied and the customer will see that the coupon has activated it.
</p>
